    <div className='container'>
        <nav className='main-nav'>
            <div className='menu-link'>
                <ul>
                    <li><a href="#">Home</a></li>
                    <li><a href="#">About Me</a></li>
                    <li><a href="#">Contact Me</a></li>
                </ul>
            </div>
        </nav>
    </div>
  )
}

export default Header
